import { useEffect, useState } from "react";
import axios from "axios";
import {useNavigate} from "react-router-dom";

export default function Home(){
    const [product, setProduct] = useState([]);
   const navigate = useNavigate();
  useEffect(() => {
    getList();
  }, []);

  const getList = () => {
    axios.get("https://reqres.in/users?page=2/api/getAll").then((resp) => {
      console.log("resp is", resp.data);
      setProduct(resp.data);
    });
  };
return(
    <div className="container">
    <div className="row">
      <div className="col-md-12">
        <h3>Home page</h3>
      </div>
      <table className="table table-bordered table-striped text-center" border="1">
<thead>
          <tr>
            <th>First Name</th>
            <th>Email</th>
            <th>Details</th>
          </tr>
        </thead>
        <tbody>
          {product.map((item) => (
            <tr key={item._id}>
              <td>{item.fname}</td>
              <td>{item.email}</td>
              <td>
                <button className="btn btn-primary" onClick={() => navigate(`/detail`)}>Details</button>
              </td>
            </tr>
          ))}
        </tbody> 
      </table>
    </div>
    </div>
)
};
